DROP VIEW IF EXISTS `v_jam_rubros`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_jam_rubros` AS select `jam_rubros`.`Id_rubros` AS `Id_rubros`,`jam_rubros`.`Nombre_rubros` AS `Nombre_rubros`,`jam_rubros`.`Estado_rubros` AS `Estado_rubros`,`jam_rubros`.`Imagen` AS `Imagen`,`jam_rubros`.`Imagen_svg` AS `Imagen_svg` from `jam_rubros` ; ;

